import React from 'react';
import styled from 'styled-components';
import PosterCard from './Components/PosterCard';

const HomeWrapper = styled.div`
  margin-top: 36px;
`;

const Home = () => {
  return (
    <HomeWrapper className="container xs-full-width">
      <PosterCard />
    </HomeWrapper>
  );
};

export default Home;
